import React, { Component } from 'react';
import '../../Globals.css';
import './Header.css';

class Header extends Component {

  render() {
    return (
      <div className="Header">
          <div className="addBtnContainer">
            <Button handleBtnClick={this.handleBtnClick} text="Add Robot"/>
            <p>Add Robot</p>
          </div>

        <h1>Bot-O-Mat</h1>
      </div>
    );
  }
}

export default Header;
